import React from "react";
import { makeStyles } from "@material-ui/core/styles";

const useStyles = makeStyles({
	root: {}
});
const Stocks = props => {
	const classes = useStyles();
	return (
		<div className={classes.root}>
			<h1>Buy Stocks</h1>
		</div>
	);
};

export default Stocks;
